import React, {Component} from 'react';

class message extends Component{
    constructor(){
        super()
        this.state = {
            message: 'welcome visiter'
        }
    }

    changeMessage(){
        this.setState({
            message: 'thanks aai......'
        })
    }
    render(){
        return(
            <div>
                <h1>{this.state.message}</h1>
                <button onClick={() => this.changeMessage()}>Subscibe</button>
            </div>
        )
    }
}

export default message
